# https://atcoder.jp/contests/abc184/tasks/abc184_b

def answer(N: int, X: int, S: str) -> str:
    for s in S:
        if s == 'o':
            X += 1
        elif X:
            X -= 1
    return str(X)


def test_入力例1():
    assert answer(3, 0, "xox") == "0"


def test_入力例2():
    assert answer(20, 199999, "oooooooooxoooooooooo") == "200017"


def test_入力例3():
    assert answer(20, 10, "xxxxxxxxxxxxxxxxxxxx") == "0"


def test_入力例4():
    assert answer(60522, 6,
                  "") == "164"

